  false,\n\t\"url\": null,\n\t\"notes\": \"The Ecosystems and Oceanography Division
  of the Pacific Islands Fisheries Science Center, National Marine Fisheries Service,
  National Oceanic and Atmospheric Administration (NOAA), conducted a cruise, OES
  04-03, in March 2004 near American Samoa on the R/V Oscar Elton Sette. Meridional
  transects were made along 170.5W and 169W between 10S and 17S. This finalized data
  set contains the profiles of temperature, salinity, dissolved oxygen, and chloropigments.
  The former three go to 1000 dbars and the latter variable to 200 dbars.\",\n\t\"license_title\":
